import React from 'react';

function ProductsPage(props) {
    return (
        <>
            <h2>This is all products page</h2>
            <ul>
                <li>Product One</li>
                <li>Product two</li>
                <li>Product three</li>
                <li>Product four</li>
            </ul>
        </>
    );
}

export default ProductsPage;
